webpackJsonp([0x75d404672555],{1194:function(e,o){e.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/link-flashsurf-complex-image-recognition-in-flash-player/index.md absPath of file >>> MarkdownRemark",html:'<p>FlashSURF is an image recognition library for Flash,  distinguishable from other projects like the QR code and face recognition  libraries by the fact that it’s just too damn clever. It’s a full colour, high resolution image recognition library that works in real time off a video feed (such as a webcam).  And it comes as a compiled SWC for flash so it’s ready to be used now.  You should at least check out <a href="http://blog.inspirit.ru/?p=386" target="_blank">Eugene\'s post</a> on the stuff to get an idea of it\'s capabilities.</p>\n<ul>\n\t<li>Blog post: <a href="http://blog.inspirit.ru/?p=386">http://blog.inspirit.ru/?p=386</a></li>\n\t<li>SWC download (Google code): <a href="http://code.google.com/p/in-spirit/source/browse/#svn/trunk/projects/FlashSURF">http://code.google.com/p/in-spirit/source/browse/#svn/trunk/projects/FlashSURF</a></li>\n\t<li>Example projects (Google code): <a href="http://code.google.com/p/in-spirit/source/browse/#svn/trunk/projects/FlashSURF.Examples">http://code.google.com/p/in-spirit/source/browse/#svn/trunk/projects/FlashSURF.Examples</a></li>\n</ul>\nSeriously, some people are just too damn clever.',frontmatter:{title:"Link: FlashSURF - complex image recognition in Flash Player",date:"February 24, 2010",tags:["flash","webcam"]}}},pathContext:{}}}});
